import ParamEntry from "./ParamEntry";
function ParamList({params}){
    console.log(Object.keys(params).map((a)=>{
        return params[a];
    }))
    return (
        <div>
            {Object.keys(params).map((param)=>{
                return (<ParamEntry paramname={param} elements={params[param]}></ParamEntry>)
            })}
        </div>
    )   
}

export default ParamList;
